import os
import shutil
import datetime
import json
import sys
import base64
import subprocess
from PyQt6.QtWidgets import (
    QApplication, QWidget, QVBoxLayout, QHBoxLayout, QPushButton, QLineEdit,
    QFileDialog, QTableWidget, QTableWidgetItem, QLabel, QHeaderView, QMessageBox,
    QMenu
)
from PyQt6.QtGui import QIcon, QPixmap, QAction, QFont
from qt_material import apply_stylesheet
from PyQt6.QtCore import Qt

banner_base64 = ""
#  elden.ico  Base64 
icon_base64 = ""



class EldenRingBackupTool(QWidget):
    def __init__(self):
        super().__init__()
        default_width = int(self.width() * 1.5)
        default_height = int(self.height() *1.5)
        self.resize(default_width, default_height)
        self.initUI()
        self.load_settings()
        self.load_backup_history()

    def initUI(self):
        layout = QVBoxLayout()

        # 
        top_layout = QHBoxLayout()

        #  banner 
        banner_label = QLabel(self)
        banner_data = base64.b64decode(banner_base64)
        banner_pixmap = QPixmap()
        banner_pixmap.loadFromData(banner_data)

        # 
        window_width = int(self.width() * 1.5)

        # 
        if banner_pixmap.width() > window_width:
            ratio = window_width / banner_pixmap.width()
            new_height = int(banner_pixmap.height() * ratio)
            banner_pixmap = banner_pixmap.scaled(window_width, new_height, Qt.AspectRatioMode.KeepAspectRatio)

        banner_label.setPixmap(banner_pixmap)
        banner_label.setScaledContents(True)  # 
        layout.addWidget(banner_label)

        # 
        select_dir_layout = QHBoxLayout()
        self.dir_label = QLabel(": ")
        self.dir_input = QLineEdit()
        self.dir_input.setReadOnly(True)
        select_dir_button = QPushButton("")
        select_dir_button.clicked.connect(self.select_backup_dir)
        select_dir_layout.addWidget(self.dir_label)
        select_dir_layout.addWidget(self.dir_input)
        select_dir_layout.addWidget(select_dir_button)

        # 
        note_and_backup_layout = QHBoxLayout()
        self.note_input = QLineEdit()
        self.note_input.setPlaceholderText("")
        backup_button = QPushButton("")
        backup_button.setProperty('class', 'success')
        backup_button.clicked.connect(self.backup_save)
        note_and_backup_layout.addWidget(self.note_input)
        note_and_backup_layout.addWidget(backup_button)

        # 50%:50%
        top_layout.addLayout(select_dir_layout, 5)
        top_layout.addLayout(note_and_backup_layout, 5)

        layout.addLayout(top_layout)

        # 
        self.table = QTableWidget()
        self.table.setColumnCount(4)
        self.table.setHorizontalHeaderLabels(["", "", "", ""])
        header = self.table.horizontalHeader()
        header.setSectionResizeMode(QHeaderView.ResizeMode.Stretch)
        layout.addWidget(self.table)

        # 
        self.table.setContextMenuPolicy(Qt.ContextMenuPolicy.CustomContextMenu)
        self.table.customContextMenuRequested.connect(self.show_context_menu)

        self.table.itemDoubleClicked.connect(self.open_directory_on_double_click)

        self.setLayout(layout)
        self.setWindowTitle(' V0.5.0          By:kleist')
        icon_data = base64.b64decode(icon_base64)
        pixmap = QPixmap()
        pixmap.loadFromData(icon_data)
        icon = QIcon(pixmap)
        self.setWindowIcon(icon)
        self.show()

    def load_settings(self):
        try:
            with open('settings.json', 'r') as f:
                settings = json.load(f)
                self.dir_input.setText(settings.get('backup_dir', ''))
        except FileNotFoundError:
            pass

    def save_settings(self):
        settings = {
            'backup_dir': self.dir_input.text()
        }
        with open('settings.json', 'w') as f:
            json.dump(settings, f)

    def select_backup_dir(self):
        dir_path = QFileDialog.getExistingDirectory(self, "")
        if dir_path:
            self.dir_input.setText(dir_path)
            self.save_settings()
            self.load_backup_history()  # 

    def backup_save(self):
        backup_dir = self.dir_input.text()
        if not backup_dir:
            return
        save_dir = os.path.join(os.getenv('APPDATA'), 'EldenRing')
        for sub_dir in os.listdir(save_dir):
            sub_dir_path = os.path.join(save_dir, sub_dir)
            if os.path.isdir(sub_dir_path):
                for file in os.listdir(sub_dir_path):
                    if file.endswith('.sl2'):
                        save_file = os.path.join(sub_dir_path, file)
                        note = self.note_input.text()
                        now = datetime.datetime.now()
                        sub_folder_name = now.strftime("%m%d_%H%M")
                        if note:
                            sub_folder_name += f"_{note}"
                        target_folder = os.path.join(backup_dir, sub_folder_name)
                        os.makedirs(target_folder, exist_ok=True)
                        shutil.copy2(save_file, target_folder)
                        self.add_backup_history(target_folder, sub_folder_name, now, note)

    def load_backup_history(self):
        backup_dir = self.dir_input.text()
        if not backup_dir or not os.path.exists(backup_dir):
            return
        self.table.setRowCount(0)
        backup_records = []
        for sub_folder in os.listdir(backup_dir):
            sub_folder_path = os.path.join(backup_dir, sub_folder)
            if os.path.isdir(sub_folder_path):
                try:
                    create_time = os.path.getctime(sub_folder_path)
                    backup_time = datetime.datetime.fromtimestamp(create_time)
                except Exception:
                    continue

                note = ""
                last_underscore_index = sub_folder.rfind('_')
                if last_underscore_index != -1:
                    note = sub_folder[last_underscore_index + 1:]

                backup_records.append((sub_folder_path, sub_folder, backup_time, note))

        # 
        backup_records.sort(key=lambda x: x[2])

        for path, sub_folder_name, backup_time, note in backup_records:
            self.add_backup_history(path, sub_folder_name, backup_time, note)

    def add_backup_history(self, path, sub_folder_name, backup_time, note):
        row_position = self.table.rowCount()
        self.table.insertRow(row_position)
        self.table.setItem(row_position, 0, QTableWidgetItem(path))
        self.table.setItem(row_position, 1, QTableWidgetItem(sub_folder_name))
        self.table.setItem(row_position, 2, QTableWidgetItem(backup_time.strftime("%Y-%m-%d %H:%M:%S")))
        self.table.setItem(row_position, 3, QTableWidgetItem(note))

    def show_context_menu(self, pos):
        menu = QMenu(self)
        restore_action = QAction("", self)
        restore_action.triggered.connect(self.restore_save)
        delete_action = QAction("", self)
        delete_action.triggered.connect(self.delete_backup)
        menu.addAction(restore_action)
        menu.addAction(delete_action)
        menu.exec(self.table.viewport().mapToGlobal(pos))

    def restore_save(self):
        selected_row = self.table.currentRow()
        if selected_row == -1:
            QMessageBox.warning(self, "", "")
            return
        backup_path = self.table.item(selected_row, 0).text()

        # 
        original_note = self.note_input.text()
        self.note_input.setText("")
        self.backup_save()
        self.note_input.setText(original_note)

        save_dir = os.path.join(os.getenv('APPDATA'), 'EldenRing')
        for sub_dir in os.listdir(save_dir):
            sub_dir_path = os.path.join(save_dir, sub_dir)
            if os.path.isdir(sub_dir_path):
                for file in os.listdir(sub_dir_path):
                    if file.endswith('.sl2'):
                        save_file = os.path.join(sub_dir_path, file)
                        backup_sl2_file = os.path.join(backup_path, file)
                        try:
                            shutil.copy2(backup_sl2_file, save_file)
                            QMessageBox.information(self, "", "")
                        except Exception as e:
                            QMessageBox.critical(self, "", f"{str(e)}")

    def delete_backup(self):
        selected_row = self.table.currentRow()
        if selected_row == -1:
            QMessageBox.warning(self, "", "")
            return
        reply = QMessageBox.question(self, '', '',
                                     QMessageBox.StandardButton.Yes | QMessageBox.StandardButton.No)
        if reply == QMessageBox.StandardButton.Yes:
            backup_path = self.table.item(selected_row, 0).text()
            try:
                shutil.rmtree(backup_path)
                self.table.removeRow(selected_row)
                QMessageBox.information(self, "", "")
            except Exception as e:
                QMessageBox.critical(self, "", f"{str(e)}")

    def open_directory_on_double_click(self, item):
        if item.column() == 0:
            path = item.text()
            if os.path.exists(path):
                try:
                    if os.name == 'nt':
                        os.startfile(path)
                    elif os.name == 'posix':
                        subprocess.Popen(['xdg-open', path])
                except Exception as e:
                    QMessageBox.critical(self, "", f"{str(e)}")


if __name__ == '__main__':
    app = QApplication(sys.argv)
    extra = {
        'font_family': "Microsoft YaHei UI Light",
        'success': '#95F8F5'
    }
    apply_stylesheet(app, theme='dark_amber.xml', extra=extra)
    ex = EldenRingBackupTool()
    sys.exit(app.exec())
    